import React from 'react';
import axios from 'axios';

import './App.css';

class App extends React.Component {

  componentDidMount() {
    axios.defaults.headers.post['Access-Control-Allow-Origin'] = '*';
    axios.get(`http://127.0.0.1:8001/api/products`, { mode: 'no-cors', headers: { 'Content-Type': 'application/json' } })

      .then(res => {
        const persons = res.data;
        console.log(persons);
      })
  }

  render() {
    return <div>test</div>;
  }
}

export default App;
